import { BaseOptionChartStyle } from "./components/charts/BaseOptionChart";
import ScrollButton from "./components/ScrollToTop";

// ----------------------------------------------------------------------

export default function App() {
  return (
    <ThemeConfig>
      <GlobalStyles />
      <BaseOptionChartStyle />

      <Router />
    </ThemeConfig>
  );
}
